import React from 'react';
import './Home.scss';

export default function Home() {
    return (
        <div>
            <div class="intro-text">
                <div class="welcome">
                    welcome to my website! I'm 
                </div>
                <div class="name">
                    <img src="./assets/name2.svg" alt="Kaili Ordiz"/>
                </div>
                <div class="descriptors">
                    product developer * UI/UX designer * 2D/3D game artist
                </div>
            </div>

            <div class="astro-img">
                <img src="./assets/Astronaut.svg" alt="Kaili Ordiz"/>
            </div>

        </div>
    );
}
